tual, contrato de alquiler , entre otros).','NO',1,NULL,'2023-11-16 14:45:49','2023-11-16 14:45:49'),(40,'ACTUALIZACIÓN DE RUC',NULL,1,1,'GRATUITO','1. Exhibir original DNI (vigente) o carnet de extranjeria\r\n2. No tener deudas electorales pendientes de pago','NO',1,NULL,'2023-11-16 14:46:09','2023-11-16 14:46:09'),(41,'RECUPERACIÓN Y/O ENTREGA DE CLAVE SOL',NULL,1,1,'GRATUITO','1. Exhibir original DNI (vigente) o carnet de extranjeria\r\n2. No tener deudas electorales pendientes de pago','NO',1,NULL,'2023-11-16 14:46:31','2023-11-16 14:46:31'),(42,'ORIENTACIÓN TRIBUTARIA',NULL,2,1,'GRATUITO','Ninguno','NO',1,NULL,'2023-11-16 14:46:50','2023-11-16 14:46:50'),(43,'ORIENTACIÓN EN ALERTA REGISTRAL',NULL,2,1,'GRATUITO','1. Exhibir original DNI o carnet de extranjeria\r\n2. Número de partida o ficha registral','NO',1,NULL,'2023-11-16 14:47:13','2023-11-16 14:47:13'),(44,'EMISIÓN DE BOLETAS INFORMATIVAS',NULL,1,1,'6.00','1. Número de placa o la tarjeta vehicular','NO',1,NULL,'2023-11-16 14:48:07','2023-11-16 14:48:07'),(45,'EMISIÓN DE CERTIFICADOS LITERALES',NULL,2,1,'A. EN CASO DE PERSONA NATURAL Y JURÍDICA:  S/. 6.00 (POR HOJA)  B. EN CASO DE PREDIO: 1. COPIA CERTIFICADA: S/. 8.00 (POR HOJA) 2. COPIA VEHICULAR: S/. 6.00 (POR HOJA)','1. Número de partida o ficha registral','NO',1,NULL,'2023-11-16 14:48:46','2023-11-16 14:48:46'),(46,'SOLIC. DE CERTIFICADO DE VIGENCIA DE PODER',NULL,1,1,'30.00','1. Número de partida o ficha registral','NO',1,NULL,'2023-11-16 14:49:38','2023-11-16 14:49:38'),(47,'CERTIF. CARGAS Y GRAVÁMENES PROPIEDAD INMUEBLE',NULL,2,1,'48.00','1. Exhibir original DNI o carnet de extranjeria\r\n2. Número de partida o ficha registral','NO',1,NULL,'2023-11-16 15:24:23','2023-11-16 15:24:23'),(48,'ORIENTACIÓN EN SERVICIOS SUNARP',NULL,2,1,'GRATUITO','Ninguno','SI',1,NULL,'2023-11-16 15:41:39','2023-11-16 15:41:39'),(49,'BÚSQUEDA DE ÍNDICES',NULL,1,1,'A. EN CASO DE PERSONA NATURAL Y JURÍDICA:  S/. 6.00  B. EN CASO DE PREDIO: S/. 8.00','1. Exhibir original DNI