de primeros auxilios, de acuerdo a \r\nLas especificaciones aprobadas por el Viceministerio de Turismo. \r\n6). Declaración jurada, de acuerdo al formato aprobado por el Viceministerio de Turismo del MINCETUR, mediante el cual se compromete a \r\nPrestar el servicio con personal especializado que cumplirá con las \r\nDisposiciones establecidas en el artículo 21 del presente Reglamento. \r\n7). Programa de Manejo de Riesgos y atención de Emergencias \r\n8). Programa de mantenimiento de Equipos. \r\n9). Manual Interno de Operaciones \r\n10). Copia de recibo de pago por derecho de tramite s/ 93.00 \r\n11). Se debe presentar los 9 anexos en orden correlativo y de acuerdo al \r\nFormato aprobado por el viceministro de Turismo y firmados por el \r\nRepresentante de la Agencia de Viajes.','2023-11-16 16:03:27','2023-11-17 20:27:09'),(84,'INSCRIPCIÓN DE UNA AGENCIA DE VIAJES Y TURISMO',NULL,1,1,'GRATUITO','Solicitud dirigida al Gerente Regional de Comercio Exterior Turismo y Artesanía\r\nDeclaración Jurada ANEXO N° 1 (Descargar)\r\nCopia de la ficha RUC\r\nCopia de la licencia Municipal\r\nCroquis de ubicación del establecimiento (CUANDO ES FUERA DEL CASCO MONUMENTAL)\r\n\r\nLocal de libre acceso al público para atender al turista y dedicado a prestar de manera exclusiva al servicio de agencia de viajes y turismo.\r\nIndependizada de los locales de negocios colindantes\r\nContar con equipo de computo\r\nConexión a internet y correo electrónico\r\nTeléfono\r\nEquipo de impresora y escáner\r\nEl personal que brinde atención directa al público acreditar experiencia mínima de un (01) año en actividades turísticas y que haya llevada por lo menos un curso de técnicas de atención al cliente, en ambos casos mediante certificado o constancia expedida por entidades públicas o privadas\r\nAcreditar formación académica superior a técnica productiva en materia de turismo, mediante de Grado o Titulo emitido por entidades públicas o privadas.\r\nEl personal calificado que se dedique a brindar atención directa al turista, debe estar identificado señalando su nombre y cargo, mediante la placa u otro medio que permita su fácil identificación por los turistas.','NO',1,NULL,'2023-11-16 16:03:47','2023-11-16 16:04:19'),(85,'INSCRIPCION O MODIFICACION EN EL REGISTRO NACIONAL DEL ARTESANO PARA ARTESANOS',NULL,1,1,'GRATUITO','Si  eres persona natural debes tener DNI                                                                                                                                                                                                                                                                                   Si representas a una empresa artesanal, debes verificar que el objeto\r\nsocial de la personería jurídica debe decir que se dedica a la\r\nproducción de artesanía.\r\nSi representas una asociación de artesanos, debes verificar la\r\nvigencia de poder de la última junta directiva inscrita en registros\r\npúblicos.\r\nSi representas a una cooperativa artesanal, verificar que el objeto\r\nsocial de la personería jurídica debe decir que se dedica a la\r\nproducción de artesanía.\r\nSi representas a una institución privada de desarrollo vinculada con el\r\nsector artesanal, debes verificar que el objeto social debe ser de\r\ndesarrollo de proyectos, capacitaciones o actividades de artesanía.\r\nCorreo electrónico.','NO',1,NULL,'2023-11-16 16:04:34','2023-11-16 16:04:34'),(86,'INSCRIPCION PARA ESTABLECIMINETOS DE RESTAURANTE CATEGORIZADOS  (1 A 5 TENEDORES) D.S.011-2019-MINCETUR',NULL,1,1,'PAGO DE ACUERDO A LA CATEGORIZACIÓN SOLICITADA.','-	D.5.011-2019-MINCETUR \r\n-	Solicitud dirigida al Gerente Regional de Comercio Exterior y Turismo \r\n-	ASUNTO: Solicito Clasificación como Restaurante categoría de ..... tenedor) \r\n-	Anexo de acuerdo a la categoría solicitada \r\n-	Copia de la Ficha RUC \r\n-	Copia del Certificado Técnico de Seguridad en Edificaciones \r\n-	Recibo de Caja por derecho a trámite establecido en el TUPA. \r\n-	Registro fotográfico.','NO',1,'-	D.5.011-2019-MINCETUR \r\n-	Solicitud dirigida al Gerente Regional de Comercio Exterior y Turismo \r\n-	ASUNTO: Solicito Clasificación como Restaurante categoría de ..... tenedor) \r\n-	Anexo de acuerdo a la categoría solicitada \r\n-	Copia de la Ficha RUC \r\n-	Copia del Certificado Técnico de Seguridad en Edificaciones \r\n-	Recibo de Caja por derecho a trámite establecido en el TUPA. \r\n-	Registro fotográfico.','2023-11-16 16:04:52','2023-11-17 20:27:56'),(87,'CERTIFICADO DE ANTECEDENTES JUDICIALES',NULL,1,1,'37.70','A. En caso el trámite lo realice el titular:\r\n1. Comprobante de pago de derecho de trámite, en el que figure el número de DNI del solicitante.\r\n2. Presentar documento de Identidad (Original):\r\n- Nacionales: DNI.\r\n- Extranjeros: Pasaporte, carné de extranjería u otro documento de identidad otorgado al amparo de tratados internacionales.\r\nPara ciudadanos extranjeros con documento de identidad distinto a carnet de extranjería deberán llevar una foto actual tamaño carnet con fondo blanco para adjuntarla a su Certificado de Antecedentes Judiciales.\r\n3. Ser mayor de edad (18 años cumplidos). Nota:\r\n- El extranjero deberá tener Notificación de Migraciones  para sus trámites.\r\nB. Si el trámite lo hace un apoderado, deberá presentar los siguientes documentos:\r\n1. Comprobante de pago de derecho de trámite, en el que figure el número de DNI del solicitante.\r\n2. Copia del documento de identidad del poderdante.\r\n3. Documento de identidad original del apoderado.\r\n4. Una foto actual tamaño carnet con fondo blanco del poderdante (solo en los casos de usuario de nacionalidad extranjera)\r\n5. Carta poder  o legalizado: según corresponda se podrá presentar los siguientes documentos:\r\n- Carta Poder Simple: Caso de cónyuge, conviviente o parientes hasta el primer grado de consanguinidad (padres e hijos según Decreto Legislativo N° 1246).\r\n- Carta Poder Notarial: Este documento deberá contar necesariamente con la firma legalizada del Poderdante ante Notario Público (Validez de un año). Para el lugar donde no exista Notario, al apoderado presentará Carta Poder con firma legalizada por el Juez de Paz Letrado o Juez de Paz del lugar donde se encuentre el usuario.\r\n- Poder Otorgado en el extranjero: Si el poderdante se encuentra en el exterior deberá:\r\n* Tramitar el poder respectivo ante el Consulado del Perú (carta poder consular original y copia legalizada)\r\n* Copia del documento de identidad del solicitante\r\n* Una foto actual tamaño carnet del solicitante con fondo blanco\r\n* DNI original del apoderado\r\n* Tramitar Carta Poder ante el Notario Público u homólogo del país en el que reside y legalizarla ante el consulado del Perú.','NO',1,NULL,'2023-11-16 16:05:20','2023-11-16 16:05:20'),(88,'CERTIFICADO DE ANTECEDENTES PENALES',NULL,1,2,'52,8','Este documento se encuentra disponible para CIUDADANOS MAYORES DE EDAD , los cuales deberán presentar la\r\nsiguiente documentación :\r\nPara Trámite Personal:\r\n1. Comprobante de pago de S/ 52.80 por concepto de Certificado de Antecedentes Penales donde figure el  número\r\nde DNI del titular.\r\n\r\n2. Documenton de Identidad (original y será presentado al realizar el trámite)\r\n  - Ciudadano Peruano: Documento Nacional de Identidad (DNI).\r\n  - Ciudadano Extranjero: Pasaporte, Carné de Extranjería u otro documento de identidad otorgado al amparo de\r\ntratados internacionales.\r\nPara Trámite por Apoderado:\r\n1. Comprobante de pago de S/ 52.80 por concepto de Certificado de Antecedentes Penales donde figure el  número\r\nde DNI del titular.\r\n2. Poder otorgado ante Notario Público o Poder Consular (en caso de estar en e l extranjero debidamente visado enel Ministerio de Relaciones Exteriores.\r\n3. Documento de Identidad del Apoderado (en original y será presentado al momento de realizar el trámite\r\n   - Ciudadano Peruano: Documento Nacional de Identidad (DNI).\r\n   - Ciudadano Extranjero:  Documento Nacional de Identidad señalado en el Poder.\r\n      01 foto actual del poderdante tamaño pasaporte a colores en fondo blanco. Indicar generales de Ley\r\n      Fecha de nacimiento y nombre de los padres (solo si el poderdante es ciudadano extranjero)\r\nNota:  \r\n  - La foto del solicitante se obtiene de la base de datos de Reniec, o de lo contrario se toma de manera GRATUITA en\r\nla oficina donde se realiza el trámite.\r\nSolo será necesario presentar la foto tamaño pasaporte a colores en fondo blanco, si el trámite  se realiza a nombre de\r\nun ciudadano extranjero mediante Poder.\r\n - El certificado es válido para uso nacional y en el exterior (previa  legalización en el Ministerio de Relaciones\r\nExteriores), tiene una vigencia de 90 días contados desde su expedición.\r\n- Los trámites \"observados\", seran atendidos en un máximo de 30 minutos salvo los realizados fuera del horario laboral\r\ndel Poder Judicial  (L-V 8:00 a 16:45 Hrs) que serán atendidos al día siguiente hábil.','NO',1,NULL,'2023-11-16 16:05:49','2023-11-17 13:18:22'),(89,'CERTIFICADO DE HOMONIMIA',NULL,1,1,'10,8','Solicitud del Certificado de Homonimia R.A. 158-2016-GG-PJ\r\n1. El ciudadano que tenga conocimiento de la existencia de un posible caso de homonimia respecto a su persona podrá solicitar\r\nel Certificado de Homonimia al Registro Nacional de Requisitorias del Poder Judicial acompañando los documentos que\r\nacrediten su identidad personal, así como los demás que estime conveniente para acreditar su pedido.\r\n2 .Previo pago del derecho correspondiente y siguiendo los mismos pasos sobre poderes en aplicación de los ítems A, B, C y D\r\ndel primer párrafo, se atenderá la solicitud de expedición de certificado de homonimia. Si este no tiene observación (pendiente\r\nde descarte) se emitirá de forma inmediata. Si el descarte tardara más de media hora el personal del Mac se comunicará con\r\nlos analistas de descartes del Registro Nacional Judicial- RENAJU.','NO',1,NULL,'2023-11-16 16:06:08','2023-11-16 16:06:08'),(90,'CERTIFICADO DE DEUDOR ALIMENTICIO MOROSO',NULL,1,1,'10.30','A. En caso la consulta la realice el titular:\r\n1. Presentar DNI o Pasaporte, CE, PTP, CPP, Cédula de Identidad, Carné de Refugiado.\r\nB. Si el trámite lo hace un apoderado (Cónyuge del titular, Conviviente del titular o Parientes hasta el 1°\r\ngrado de consanguineidad), deberá presentar Carta poder simple.En caso de abogado debe presentar su carnet de colegiatura\r\nhabilitado.\r\n2 .Previo pago del derecho correspondiente y siguiendo los mismos pasos sobre poderes en aplicación de los ítems A, B, C y D\r\ndel primer párrafo, se atenderá la solicitud de expedición de certificado de Redam, la emisión es inmediata.','NO',1,NULL,'2023-11-16 16:06:29','2023-11-16 16:06:29'),(91,'ACREDITACIÓN COMPLEMENTARIA Y ACREDITACIÓN POR LATENCIA',NULL,1,1,'GRATUITO','ACREDITACION COMPLEMENTARIA                                                                               \r\n1. DNI, carnet de extranjería o Partida de Nacimiento.\r\n2. Si eres trabajador debe contar con 03 meses de aportaciones consecutivas o 04 no consecutivos dentro de los 06 meses calendarios anteriores al mes que se incio la contingencia.\r\n3. Si eres Pensionista de la ONP, presentar la Resolucion en tramite de pensionista,\r\n4. Si eres trabajador del hogar: debe contar con 03 meses de aportaciones consecutivas o 04 no consecutivos dentro de los 06 meses calendarios anteriores al mes que se incio la contingencia..\r\nLATENCIA : Debe contar con el cese laboral registrado por el empleador, en caso suspenssion perfecta de labores SPL debe contar con registro de Suspension perfecta en PLAME.','NO',1,NULL,'2023-11-16 16:06:51','2023-11-16 16:06:51'),(92,'ACTUALIZACIÓN Y MODIFICACIÓN DE DATOS DEL ASEGURADO TITULAR O DERECHOHABIENTES',NULL,1,1,'GRATUITO','1. Documento de Identidad del asegurado titular original (DNI, carnet de Extranjería o Pasaporte).\r\n2. Documento de Identidad del solicitante (DNI, carnet de Extranjería o Pasaporte) original.                                                                                                                 \r\n3. Llenar el formulario  1010.','NO',1,NULL,'2023-11-16 16:07:06','2023-11-16 16:07:06'),(93,'AFILIACIÓN AL SCTR INDEPENDIENTE - SEGURO COMPLEMENTARIO DE TRABAJO DE RIESGO',NULL,1,1,'GRATUITO','Para Trabajadores Independientes\r\n1. Formulario Nº 6004\r\n2. mostrar documento de identidad: DNI, Carnet de extranjería, de corresponder.','NO',1,NULL,'2023-11-16 16:07:21','2023-11-16 16:07:21'),(94,'AFILIACIÓN AL SEGURO POTESTATIVO',NULL,1,1,'0 - 17 AÑOS: S/. 137.00 * 18 - 29 AÑOS: S/. 132.00 * 30 - 59 AÑOS: S/. 138.00 * 60 A MAS: S/. 215.00 * * APORTE MENSUAL','1. Documento Nacional de Identidad del asegurado titular original.                               \r\n2. formulario 1010 y clausulas de contrato seguro potestativo','NO',1,NULL,'2023-11-16 16:07:41','2023-11-16 16:07:41'),(95,'CAMBIO DE ADSCRIPCIÓN TEMPORAL DEL ASEGURADO TITULAR O DERECHOHABIENTES',NULL,1,1,'GRATUITO','Cambio de Adscripción Temporal (Desplazamiento temporal a una Provincia o Departamento por un periodo máximo de 6 meses en 1 año calendario). \r\nTitular: Presentar el Formulario F-1010 y CONSTANCIA DE DESPLAZAMIENTO TEMPORAL POR MOTIVOS LABORALES firmado por el titular, en caso de desplazamiento por motivos laborales.\r\nPara los demás casos de desplazamiento (motivos no laborales) presentar el Formulario F-1010, debidamente llenado y firmado por el afiliado titular.\r\nDerechohabiente: Presentar el Formulario F-1010 firmado por el afiliado titular, cónyuge, concubino(a), padre, madre, tutor o curador, según corresponda.','NO',1,NULL,'2023-11-16 16:08:04','2023-11-16 16:08:04'),(96,'REGISTRO DE BENEFICIARIOS AL SEGURO DE ACCIDENTES + VIDA',NULL,1,1,'5.00','Registro de Beneficiarios\r\nPara Asegurados Regulares e Independientes con un seguro en EsSalud - Formulario 6012 – Registro de beneficiarios +Vida','NO',1,NULL,'2023-11-16 16:08:27','2023-11-16 16:08:27'),(97,'REGISTRO DE INSCRIPCIÓN Y BAJA EXCEPCIONAL DE TITULAR Y DERECHOHABIENTES',NULL,1,1,'GRATUITO','Inscripción de Derechohabientes - Llenar formulario 1010 y Politicas de Privacidad.\r\n1. Cónyuge: En Perú: Copia simple del Acta o Partida de Matrimonio Civil, con una antigüedad no mayor de seis (06) meses. Extranjero:\r\nCopia simple del acta, con el sello de apostilla. \r\no partida de matrimonio que haya sido inscrita en el Registro de la oficina consular de Perú del lugar de celebración del acto o legalizada por el Consulado\r\nPeruano de su jurisdicción y por el Ministerio de Relaciones Exteriores e inscrito en la Municipalidad o RENIEC o que cuente con el sello de la Apostilla de La Haya.\r\n2. Concubino: Copia simple del documento de Reconocimiento de la Unión de Hecho, sea por Resolución Judicial o por Escritura Pública.\r\n3. Hijo Menor de Edad: Copia simple de la Partida o Acta de nacimiento del menor.\r\n4. Gestante: Copia simple de escritura de reconomiento de hijo extramatrimonial.(Notarialmente).\r\nBaja de Titular y/o Derechohabientes - Llenar formulario 1010\r\nPor fallecimiento en el país: Presentar Formulario 1010 debidamente llenado y\r\nfirmado por quien corresponda. Por fallecimiento en el extranjero: Copia simple de la partida de defunción o su equivalente, cuyo original se encuentre\r\nlegalizado por el consulado en el Perú del país donde falleció el  derecho habiente o cuente con el sello de la Apostilla de La Haya. Si el documento se encuentra redactado en idioma distinto al español, se requiere la traducción.         \r\nPor disolución del vínculo matrimonial en el país : Copia simple de la resolución judicial, resolución de alcaldía,\r\no de la escritura pública que declara disuelto el vínculo matrimonial.\r\nPor disolución del vínculo matrimonial en el extranjero: Copia simple de la resolución judicial de sentencia de divorcio expedida por el Tribunal extranjero y\r\nlegalizada por el Ministerio de Relaciones Exteriores o que cuente con el sello.','NO',1,NULL,'2023-11-16 16:08:48','2023-11-16 16:08:48'),(98,'ORIENTACIÓN DE ESTADO DEL ASEGURADO Y OTROS SERVICIOS',NULL,2,1,'GRATUITO','Presentar documento de Identidad (Original)','NO',1,NULL,'2023-11-16 16:09:07','2023-11-16 16:09:07'),(99,'CONSTANCIA DE VERIFICACIÓN DE DATOS DE AUTORIDADES',NULL,1,2,'GRATUITO','Para el trámite en línea, la solicitud se realiza en el link: https://enlinea.sunedu.gob.pe/.\r\nPara el trámite presencial, la solicitud se realiza en el módulo de la Sunedu. Para la emisión de la constancia de verificación de datos de autoridades, los datos del Secretario General que suscribió el documento, o quien haga sus veces, deben encontrarse previamente inscritos en la Base de Datos de Autoridades; caso contrario, los documentos deben ser autenticados por el Secretario General en funciones, o quien haga sus veces, que deberá encontrarse inscrito en la Base de Datos de Autoridades. Los usuarios, antes de solicitar la constancia, pueden verificar en el portal institucional de la Sunedu (https://enlinea.sunedu.gob.pe/) si los datos del Secretario General que suscribió el documento, o quien haga sus veces, se encuentran previamente inscritos en la Base de Datos de Autoridades. Los documentos emitidos por las universidades, escuelas de posgrado o instituciones y escuelas de educación superior autorizadas a otorgar grados y títulos de rango universitario, deben contar con los nombres y apellidos del titular del documento sujeto a verificación de datos. Los documentos emitidos por las universidades, escuelas de posgrado o instituciones y escuelas de educación superior deben contar con fecha de expedición, de certificación o de autenticación, según sea el caso.\r\n1) Diploma del grado o título (previamente inscrito en el Registro Nacional de Grados y Títulos);\r\n2) Diplomado de posgrado (se debe haber completado un mínimo de 24 créditos).\r\n3) Documentos de formación profesional provenientes de universidades, entregados en el marco de los programas de formación continua, que deben certificar nota aprobatoria.\r\n4) Certificados de estudios, sílabos, constancia de matrícula, malla curricular o plan de estudios, constancias y/o certificados que acrediten la condición del solicitante.\r\nPara el trámite en línea, la solicitud se realiza en el link: https://enlinea.sunedu.gob.pe/','NO',1,NULL,'2023-11-16 16:15:22','2023-11-16 16:15:22'),(100,'CONSTANCIA DE INSCRIPCIÓN  DE GRADOS Y TÍTULOS EN EL REGISTRO NACIONAL DE GRADOS Y TÍTULOS',NULL,1,2,'GRATUITO','Para el trámite en línea, la solicitud se realiza en el link: https://enlinea.sunedu.gob.pe/.\r\nPara el trámite presencial, la solicitud se realiza en el módulo de la Sunedu. Para la emisión de la constancia, los grados y títulos deberán estar previamente inscritos en el Registro Nacional de Grados y Títulos, a solicitud de las universidades, escuelas de posgrado o instituciones y escuelas de educación superior autorizadas a otorgar grados o títulos de rango universitario','NO',1,NULL,'2023-11-16 16:15:43','2023-11-16 16:15:43'),(101,'ORIENTACIÓN EN LOS SERVICIOS DE LA SUNADU',NULL,2,1,'GRATUITO','Servicio que consiste en brindar orientación a los ciudadanos sobre las funciones de la Sunedu, servicios ofrecidos; así como algunos alcances de la Ley N° 30220 – Ley Universitaria y demás normativa emitida por la Sunedu.','NO',1,NULL,'2023-11-16 16:16:01','2023-11-16 16:16:01'),(102,'AFILIACIÓN AL SIS EMPRENDEDOR',NULL,1,1,'GRATUITO','1. Presentar DNI o Carnet de Extranjeria Vigente\r\n2. No contar con otro seguro de salud.\r\n3. Contar con el pago tres meses consecutivos a la SUNAT en las categorías 1 o 2 del Nuevo RUS\r\n(NRUS)','NO',1,NULL,'2023-11-16 16:17:14','2023-11-16 16:17:14'),(103,'AFILIACIÓN AL SIS GRATUITO',NULL,1,2,'GRATUITO','1. Presentar DNI o Carnet de Extranjeria Vigente.\r\n2. No tener otro seguro de salud.\r\n3. Contar con CSE (Clasificación Socioeconómica) de pobreza o pobreza extrema en el SISFOH','NO',1,NULL,'2023-11-16 16:17:31','2023-11-16 16:17:31'),(104,'AFILIACIÓN AL SIS INDEPENDIENTE',NULL,1,2,'MENOR DE 60 AÑOS: S/. 39.00 A PARTIR DE 60 AÑOS: S/. 58.00  * PAGO INDIVIDUAL  \'- TITULAR + 01 DERECHOHABIENTE: S/ 78.00 - TITULAR + 02 DERECHOHABIENTES: S/ 94.00 - TITULAR + 03 DERECHOHABIENTES: S/ 115.00 (PAGO FAMILIAR)','1. Presentar DNI o Carnet de Extranjeria Vigente\r\n2. No contar con otro seguro de salud.','NO',1,NULL,'2023-11-16 16:17:53','2023-11-16 16:17:53'),(105,'INFORMACIÓN SOBRE AFILIACIÓN  SOBRE AFILIACIÓN AL SIS MYPE',NULL,2,1,'EL PAGO ES DE S/ 15.00 MENSUALES POR CADA TRABAJADOR INSCRITO, SIN COSTO ADICIONAL POR DERECHOHABIENTES INSCRITOS MENORES DE 18 AÑOS Y MAYORES CON DISCAPACIDAD.','1. El trámite lo realiza exclusivamente el empleador\r\n2.Contar con una Clave de Sol\r\n3. Contar con un correo electrónico \r\n4. No contar con otro seguro de salud\r\n5. La empresa debe estar registrada en REMYPE\r\n6. Tener los DNIs o CE vigentes de los trabajadores y sus derechohabientes','NO',1,NULL,'2023-11-16 16:18:12','2023-11-16 16:18:12'),(106,'AFILIACIÓN AL SIS PARA TODOS',NULL,1,1,'GRATUITO','1. DNI o carnet de extranjeria\r\n2. No contar con ningun seguro activo','NO',1,NULL,'2023-11-16 16:18:29','2023-11-16 16:18:29'),(107,'AFILIACIÓN DE GESTANTE (POBLACIÓN DETERMINADA POR NORMA)',NULL,1,1,'GRATUITO','1. Presentar DNI o Carnet de Extranjeria Vigente ,\r\n2. No contar con otro seguro de salud\r\n3. Carné de control prenatal o cualquier documento en donde figura la fecha probable de parto\r\n\r\nEN CASO DE NO CONTAR CON DNI\r\n La gestante puede presentar su Acta de Nacimiento o un documento que las identifique como tal, el cual puede ser emitido por una institución o autoridad competente (Nacional y/o extranjera). En caso de no contar con ningún documento que lo identifique, debe presentar una Declaración Jurada conteniendo los datos de la persona, en caso de menores de edad, la Declaración Jurada de padres o tutor).','NO',1,NULL,'2023-11-16 16:18:49','2023-11-16 16:18:49'),(108,'AFILIACIÓN MENOR DE 5 AÑOS (POR NORMA)',NULL,1,1,'GRATUITO','1. Presentar, DNI o carnet de extranjeria vigente de los padres o tutores\r\n2. No contar con otro seguro de salud\r\n\r\nEN CASO DE NO CONTAR CON DNI\r\nLos menores de edad entre cero (0) a cinco (5) años, para la identificación pueden presentar el Acta de Nacimiento o Certificado de Nacido Vivo o Tarjeta de Control de Niño Sano o un documento que los identifique como tal, el cual puede ser emitido por una institución o autoridad competente (Nacional y/o extranjera). En caso de no contar con ningún documento que identifique al menor, deben presentar una Declaración Jurada de padres o tutor, conteniendo los datos del menor','NO',1,NULL,'2023-11-16 16:19:03','2023-11-16 16:19:03'),(109,'ACTUALIZACIÓN DE DATOS',NULL,1,1,'GRATUITO','1. Presentar DNI o Carnet De Extranjería\r\n2. Mencionar el tipo de tramite que desea realizar','NO',1,NULL,'2023-11-16 16:19:38','2023-11-16 16:19:38'),(110,'ORIENTACIÓN EN LOS SERVICIOS DEL SIS',NULL,2,1,'GRATUITO','Ninguno','NO',1,NULL,'2023-11-16 16:19:54','2023-11-16 16:19:54'),(111,'ATENCIÓN DE QUEJAS Y RECLAMOS',NULL,1,2,'GRATUITO','1. DNI o CE del Usuario del reclamante y/o tercero legitimado.\r\n2. Documentos de sustento motivo de reclamo (si lo tuviese).\r\n3. Numero o correo electrónico de contacto','NO',1,NULL,'2023-11-16 16:20:50','2023-11-16 16:20:50'),(112,'ATENCIÓN DE SUGERENCIAS',NULL,2,1,'GRATUITO','1. DNI o CE vigente del Usuario','NO',1,NULL,'2023-11-16 16:21:11','2023-11-16 16:21:11'),(113,'ATENCIÓN DE INCIDENCIAS',NULL,2,1,'GRATUITO','1. DNI o CE vigente del Usuario','NO',1,NULL,'2023-11-16 16:21:34','2023-11-16 16:21:34'),(114,'LEVANTAMIENTO DE ANULACIÓN DE SIS',NULL,1,1,'GRATUITO','1. DNI o carnet de extranjeria.\r\n2. No contar con seguro activo','NO',1,NULL,'2023-11-16 16:21:53','2023-11-16 16:21:53'),(115,'ORIENTACIÓN SERVICIOS RENIEC',NULL,2,1,'GRATUITO','Ninguno','NO',1,NULL,'2023-11-16 16:22:21','2023-11-16 16:22:21'),(116,'CANJE DE LE A DNI',NULL,1,2,'GRATUITO','Requisitos Generales:\r\n1. Menores de 07 años deben presenta 01 Fotografía actualizada tamaño pasaporte a color con fondo blanco, sin retoques, sin lentes, sin prendas en la cabeza. \r\nMayores de 07 años las fotografías se toma mediante captura en vivo.\r\n2. Recibo de servicio público (luz, agua, cable, teléfono, arbitrios, etc.), en copia y original, con una antigüedad no mayor a 6 meses. Requisitos Específicos:\r\nA. Canje de Libreta Electoral a DNI:\r\nProcedimiento que deben realizar las personas mayores de edad cuyo último documento de identidad es la Libreta Electoral de ocho (08) dígitos y que aun no han tramitado su DNI.\r\n- Informe Médico Expedido por Autoridad Competente.','NO',1,NULL,'2023-11-16 16:22:41','2023-11-16 16:22:41'),(117,'DUPLICADO DE DNI (SOLO DNI AZUL)',NULL,1,2,'PARA MAYOR DE EDAD  (DNI AZUL): S/ 24.00 PERSONA CON DISCAPACIDAD GRATUITO','Requisitos Generales:\r\n1. Voucher de pago.\r\n2. En caso de menor de edad, el trámite debe realizarse por el último declarante del menor. Nota:\r\n* La vigencia del último DNI debe ser mayor a 60 días antes de su fecha de caducidad.\r\n* La fecha de caducidad del DNI no se modificará en el duplicado de DNI. Requisitos Específicos: - Personas con Discapacidad: A. Original y copia simple del Certificado de Discapacida','NO',1,NULL,'2023-11-16 16:22:59','2023-11-16 16:22:59'),(118,'RECTIFICACIÓN DE DATOS CON EMISIÓN DE DNI (NOMBRES, APELLIDOS, DOMICILIO, ESTADO CIVIL, CAMBIO EN LA DECISIÓN DE CEDER ÓRGANOS Y TEJIDOS)',NULL,1,2,'PARA MENOR DE EDAD (HASTA LOS 16 AÑOS): S/ 16.00 (NOMBRES, APELLIDOS Y DOMICILIO)','Requisitos Generales:\r\n1. Documento sustentatorio de la rectificación que se solicita.\r\n2. Voucher de pago.\r\n3. En caso de menor de edad, la rectificación debe realizarse por el declarante que realizó el último trámite del menor. \r\nNota: La vigencia del último DNI debe ser mayor a 60 días antes de su fecha de caducidad. Menor de Edad: El declarante debe exhibir su DNI. Requisitos Específicos:\r\n- Cambio en la decisión de ceder órganos y tejidos: Ninguno (Declarativo)\r\nA. Nombres y Apellidos:\r\n-Vía Judicial: Copia simple de la Resolución Judicial de la Rectificación.\r\n-Vía Notarial: Copia Certificada y copia simple de la Escritura Pública Rectificatoria.\r\n-Vía Administrativa: Copia Certificada y copia simple del expediente administrativo y Resolución Registral de la Rectificación.\r\nB. Domicilio: Recibo de servicio público (luz, agua, cable, teléfono, arbitrios, etc.) en original y copia, con una antigüedad no mayor a 6 meses.\r\nC. Estado Civil:\r\na. Casado: Declaración Jurada indicando esa condición según el formato de RENIEC o la Copia Certificada del Acta de Matrimonio.*\r\n- Mujeres casadas (apellido del esposo): Copia Certificada del Acta de Matrimonio Civil.\r\nb. Divorciado: Copia Certificada del Acta de Matrimonio expedida por el Registro del Estado Civil con la anotación marginal de la disolución del vínculo matrimonial.\r\nc. Viudo: Declaración Jurada de Matrimonio y copia certificada del Acta de Defunción del cónyuge, expedida por el Registro del Estado Civil.\r\nd. De Casado a Soltero:\r\n- Administrativamente: Resolución emitida por la Sub Gerencia de Depuración de Identificación, que resuelve rectificar el dato del estado civil.\r\n- Por Mandato Judicial: Oficio y parte con resolución judicial consentida o ejecutoriada que corresponda.\r\nNota:\r\n- Anulación de vínculo matrimonial: Copia Certificada del Acta de Matrimonio Civil donde conste la anotación de nulidad y la copia certificada y simple de la resolución judicial firme. En este caso se revierte el estado civil anterior.\r\n- Las personas bautizadas antes del 14 de noviembre de 1936 pueden realizar su rectificación con la partida de bautismo autenticada por el notario eclesiástico\".\r\n* No será necesario presentar la Copia Certificada del Acta de Matrimonio cuando ésta se encuentra en el Sistema de Registros Civiles del RENIEC.','NO',1,NULL,'2023-11-16 16:24:17','2023-11-1