cesado su situación de discapacidad desean retirar dicha condición de su inscripción:\r\n- Informe médico expedido por autoridad competente','NO',1,NULL,'2023-11-16 16:25:38','2023-11-16 16:25:38'),(122,'RECTIFICACIÓN DE DATOS CON EMISIÓN DE DNI (REGISTRO DE DISCAPACIDAD)',NULL,1,2,'GRATUITO','Requisitos Generales:\r\n1. Una Fotografía actualizadas tamaño pasaporte a color en fondo blanco, sin retoques , sin lentes, sin prendas en la cabeza excepto las religiosas.\r\nRequisitos Específicos:\r\nA. Registro de Discapacidad: Original y copia simple del Certificado de Discapacidad en el formato aprobado por el MINSA o de la Constancia Médica de Discapacidad, que señale la discapacidad (Física, Sensorial, Mental, Intelectual).\r\n* Nota:\r\n- Personas con Discapacidad mental o intelectual, que no puedan efectuar por si mismos el procedimiento: Exhibir el DNI de los padres o de uno de ellos, de los abuelos o de quien ejerza su cuidado.\r\n- Las personas con discapacidad, podrán efectuar el trámite de manera personal y directa u opcionalmente asistidos por quien ejerza su cuidado.\r\n- Sólo se consignará la condición de discapacidad del titular de la inscripción en el DNI o Padrón Electoral, a solicitud del interesado.','NO',1,NULL,'2023-11-16 16:26:51','2023-11-16 16:26:51'),(123,'RENOVACIÓN DE DNI / RECTIFICACIÓN DE IMAGEN Y DATOS',NULL,1,2,'PARA MENOR DE EDAD (HASTA LOS 16 AÑOS): S/ 16.00 ORDINARIO (DE 17 AÑOS A MÁS): S/ 30.00 PERSONAS CON DISCAPACIDAD GRATUITO','Requisitos Generales:\r\n1. Procede dentro de los 60 días previos al vencimiento del DNI.\r\n2. Menores de 07 años deben presenta 01 Fotografía actualizada tamaño pasaporte a color con fondo blanco, sin retoques, sin lentes, sin prendas en la cabeza. \r\nMayores de 07 años las fotografías se toma mediante captura en vivo.\r\n3. Voucher de pago.\r\nRequisitos Específicos:\r\n- Personas con Discapacidad:\r\nA. Original y copia simple del Certificado de Discapacidad en el formato aprobado por el MINSA o de la Constancia Médica de Discapacidad, que señale la discapacidad (Física, Sensorial, Mental, Intelectual).','NO',1,NULL,'2023-11-16 16:33:06','2023-11-16 16:33:06'),(124,'ENTREGA DE DNI',NULL,1,2,'GRATUITO','Requisitos Generales:\r\n1. Voucher de tramite realizado \r\nNota: Para DNI realizado por Tramite Web o DNI electronico el recogo es personal.','NO',1,NULL,'2023-11-16 16:34:01','2023-11-16 16:34:01'),(125,'CERTIFICADO DE INSCRIPCIÓN DE IDENTIDAD (C4-FICHA RENIEC) - ADULTOS',NULL,1,2,'4.50','1. Voucher de pago en original','NO',1,NULL,'2023-11-16 16:34:26','2023-11-16 16:34:26'),(126,'CERTIFICADO DE INSCRIPCIÓN DE IDENTIDAD (C4-FICHA RENIEC) - MENORES',NULL,1,2,'4.50','1. Voucher de pago en original.\r\nNota: En caso de menor de edad, el Certificado de Inscripción debe ser tramitado por el padre, la madre o por el declarante','NO',1,NULL,'2023-11-16 16:34:57','2023-11-16 16:34:57'),(127,'CERTIFICADO DE NOMBRES IGUALES - HOMONIMIA',NULL,1,2,'4.10','1. Voucher de pago en original.\r\nNota: En caso de menor de edad, el Certificado de Inscripción debe ser tramitado por el padre, la madre o por el declarante.','NO',1,NULL,'2023-11-16 16:36:16','2023-11-16 16:36:16'),(128,'CONSTANCIA NEGATIVA DE INSCRIPCIÓN DE MATRIMONIO',NULL,1,2,'4.10','1. Voucher de pago en original.\r\nNota: Este servicio sólo está disponible para actas de distritos incorporados al sistema de RENIEC.','NO',1,NULL,'2023-11-16 16:37:20','2023-11-16 16:37:20'),(129,'COPIA LITERAL DE ACTA DE MATRIMONIO (REGISTRADO EN RENIEC)',NULL,1,2,'12.00','1. Voucher de pago en original.\r\nNota: Este servicio sólo está disponible para actas de distritos incorporados al sistema de RENIEC','NO',1,NULL,'2023-11-16 16:38:00','2023-11-16 16:38:00'),(130,'COPIA LITERAL DE PARTIDA DE DEFUNCIÓN (REGISTRADO EN RENIEC)',NULL,1,2,'12.00','1. Voucher de pago en original.\r\nNota: Este servicio sólo está disponible para actas de distritos incorporados al sistema de RENIEC','NO',1,NULL,'2023-11-16 16:38:54','2023-11-16 16:38:54'),(13